import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.sass';
import App from './App';
import {Link, Router} from "react-router-dom"

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Router>
      <App />
    </Router>
  </React.StrictMode>
);
